import React from 'react';
import Popup from './Popup.js';
import { MDBContainer, MDBRow, MDBCol, MDBFormInline, MDBIcon, MDBBtn } from "mdbreact";
import '../Styles/MeetTeam.css';

export class Member extends React.Component{
  constructor(props){
    super(props);
  }


  render(){
    return(

      <MDBCol>
        <img className="memberPic" src={this.props.picSrc}/>
        <h2 className="memberName">{this.props.name}</h2>
        <h3 className="memberTitle">title/position in openspace</h3>
      </MDBCol>

    );
  }
}
export default Member;
